xt 1.1\",\"params\":{\"text\":\"<p><span style=\\\"color:#bd202e\\\"><strong>Movement of flexion</strong></span>: The <strong>biceps contracts</strong> (thickens and shortens). It moves the bones to which it is attached making the forearm bend towards the upper arm. Meanwhile, the <strong>triceps relaxes</strong>.</p>\\n\"},\"subContentId\":\"219df932-ec87-42dd-8048-6b970dbde234\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.1406839769262447,\"y\":70.03829513233849,\"width\":97.71863204614752,\"height\":13.555799057871965,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"color:#bd202e\\\"><strong>Movement of extension</strong></span>: The <strong>triceps contracts.</strong>It moves the bones to which it is attached and makes the forearm unfold. Meanwhile, the <strong>biceps relaxes</strong>.</p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"c7c86fb2-531c-4d7e-9a87-4fd4dabd2821\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.138307932202307,\"y\":85.85113473334613,\"width\":98.85931602307376,\"height\":14.144165922980468,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>When the biceps contracts, the triceps relaxes. When the triceps contracts, the biceps relaxes. These muscles have opposite actions. They are called <span style=\\\"color:#bd202e\\\"><strong>antagonistic muscles</strong></span>.</p>\\n\"},\"subContentId\":\"50335651-e3ab-4ed4-8215-d0b1a5ce45f1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\" 55, 0)\",\"borderWidth\":\"1\",\"borderStyle\":\"solid\",\"borderColor\":\"rgb(77, 91, 169)\",\"borderRadius\":\"0\"},\"type\":\"rectangle\",\"line\":{\"borderColor\":\"#000000\",\"borderWidth\":\"1\",\"borderStyle\":\"solid\"}},\"subContentId\":\"0498135b-ab37-4e9c-86c3-f19afafe32af\",\"metadata\":{\"contentType\":\"Shapes\",\"license\":\"U\"}},\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false},{\"x\":58.17488282323848,\"y\":2.259299842978661,\"width\":41.064623169344806,\"height\":27.106853586073676,\"action\":{\"library\":\"H5P.Shape 1.0\",\"params\":{\"shape\":{\"fillColor\":\"rgba(255, 255, 255, 0)\",\"borderWidth\":\"1\",\"borderStyle\":\"solid\",\"borderColor\":\"rgb(221, 118, 167)\",\"borderRadius\":\"0\"},\"type\":\"rectangle\",\"line\":{\"borderColor\":\"#000000\",\"borderWidth\":\"1\",\"borderStyle\":\"solid\"}},\"metadata\":{\"contentType\":\"Shapes\",\"license\":\"U\"},\"subContentId\":\"71104181-4365-423e-9607-1a3f5b20ca8d\"},\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false},{\"x\":59.31556680016472,\"y\":4.518599685957322,\"width\":38.78325521549232,\"height\":22.59299842978661,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Bones need <strong><span style=\\\"color:#dd76a7\\\">calcium</span></strong>, <strong><span style=\\\"color:#dd76a7\\\">vitamin D</span> </strong>and <strong><span style=\\\"color:#dd76a7\\\">phosphorus</span></strong><span style=\\\"color:#4d5ba9\\\"> </span>for their proper growth.</p>\\n\\n<p><strong><span style=\\\"color:#dd76a7\\\">Proteins</span></strong> are necessary for muscle growth and <strong><span style=\\\"color:#dd76a7\\\">sugars</span></strong>are necessary for muscle activity.</p>\\n\"},\"subContentId\":\"52d37abe-cbe9-4b42-9aa1-cc325237bb56\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":75.28514247713214,\"y\":31.630197801701254,\"width\":23.95322283147421,\"height\":31.630197801701254,\"action\":{\"library\":\"H5P.Shape 1.0\",\"params\":{\"shape\":{\"fillColor\":\"rgba(255, 255, 255, 0)\",\"borderWidth\":\"1\",\"borderStyle\":\"solid\",\"borderColor\":\"rgb(1, 97, 83)\",\"borderRadius\":\"0\"},\"type\":\"rectangle\",\"line\":{\"borderColor\":\"#000000\",\"borderWidth\":\"1\",\"borderStyle\":\"solid\"}},\"metadata\":{\"contentType\":\"Shapes\",\"license\":\"U\"},\"subContentId\":\"f5b6971e-61ae-4ecf-9d41-eedcfb0ac6f1\"},\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false},{\"x\":76.42582645405838,\"y\":33.66356766038205,\"width\":21.672995561598647,\"height\":31.630197801701254,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Physical exercise enhances the normal <span style=\\\"color:#016153\\\"><strong>development</strong> </span>of bones, allows muscles to become <strong><span style=\\\"color:#016153\\\">stronger</span></strong>, and keeps the joints <strong><span style=\\\"color:#016153\\\">flexible</span></strong>.</p>\\n\"},\"subContentId\":\"ea34ee95-110d-41ae-89df-337d94065e15\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":58.17134670291,\"y\":67.77673598951685,\"width\":41.06348248536788,\"height\":31.616190142674785,\"action\":{\"library\":\"H5P.Shape 1.0\",\"params\":{\"shape\":{\"fillColor\":\"rgba(255, 255, 255, 0)\",\"borderWidth\":\"1\",\"borderStyle\":\"solid\",\"borderColor\":\"rgb(250, 175, 67)\",\"borderRadius\":\"0\"},\"type\":\"rectangle\",\"line\":{\"borderColor\":\"#000000\",\"borderWidth\":\"1\",\"borderStyle\":\"solid\"}},\"metadata\":{\"contentType\":\"Shapes\",\"license\":\"U\"},\"subContentId\":\"516e174c-bc06-4dbf-8778-22812ee9f46f\"},\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false},{\"x\":2.2789953311804823,\"y\":27.106853586073676,\"width\":20.532311584672403,\"height\":61.001095760423844,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Sleep is essential for bone and muscle <span style=\\\"color:#4d5ba9\\\"><strong>growth</strong></span>. Sleep time allows the body to maintain body organs in <span style=\\\"color:#4d5ba9\\\"><strong>good shape</strong></span>. Sleep duration depends on the age of the individual. The recommended sleep time for a child aged 6 to 13 is <span style=\\\"color:#4d5ba9\\\"><strong>around 10 hours.</strong></span></p>\\n\"},\"subContentId\":\"6514bc8f-971e-46f2-8664-ea59eb806689\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.1406839769262447,\"y\":2.259299842978661,\"width\":40.000022813679536,\"height\":9.037199371914644,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h3><strong>Bone and muscle health</strong></h3>\\n\"},\"subContentId\":\"b614772b-3b8c-401d-a2d1-496d36c40708\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":59.31556680016472,\"y\":70.03829513233849,\"width\":38.403065245982795,\"height\":28.688363476158738,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>When you stand, sit, walk, or lift a heavy load, you must maintain <span style=\\\"color:#faaf43\\\"><strong>a good posture</strong></span>. A good posture keeps the bones and muscles in good shape and prevents problems in the skeleton, such as a deformity in the vertebral column called \\\"scoliosis\\\".</p>\\n\"},\"subContentId\":\"0523df45-f75b-4468-b003-68481c2daaba\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":8.326993031561585,\"y\":0,\"width\":82.78160350509374,\"height\":99.40444856139082,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAABs4AAAQjCAYAAADAP9vIAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAAFxEAABcRAcom8z8AAP+lSURBVHhe7P0JlGVXeSf4vm6/99zYjVfrFVWFWW5TXV2u8nrVttWuLp7dLoxhtcum3oNligJTBQU2g8GNARskWhgDBiwmIUBYQshMZhCWQFLmjUyUkpAQAqUGhAY0pCQ0pFKpWSllKjWmyLvPO9+NfaSTRzsibkRG3LjD77fWfykz48S9Z9p7n7s/nXP/bwAAABy8lNKz6jy/zkvqvLrOm6uqOqL+75F1Pl3ni3W+WeeMOlvrXFlne51ddfblxJ/j3+JnsUwse0qdL9WJ1zgyv+ab68R7xHvFez4rrwYAAAAAAACsvZTS06qqOrT+78vr/FWdr9a5uP63PXXW255YlzpfyesW6/hrdZ6WVx8AAAAAAACWp6qqZ6aUfrdO3Nl1TJ248+vm+fpU2f6HHqse3X5v9dBVO6u9l26vHrjgx9Xuc7dV953xo2pX79Lqnm9cVN311fOrOz//3er2475d7fzElmrHR+aqW95/WnXzX548SPw5/i1+FsvEsvE78bvxGvFa8Zrx2vEe8V7xnvHei4l1r7Mlb0ts0+/W//zMvLkAAAAAAAAwr6qqQ+r8QUrpU3Uuj2JTUT9V++5+oHro6p2DAtY937y4uv0z3x4UvG565z+sa2IdYl1inWLdYh1jXWOdFxLbmrf5JfVfD8m7AwAAAAAAgFlRVdXPpJReWOejdS4aVJFa+o/vrx696e7qgYturHZtvry680vnVbd+bHOxYDUJiXWPbYhtiW2KbYtt7Ip9kffJC+u//kzeXQAAAAAAAEyLqqp+KqX0gjofqHPeoErUllL1yI13VfefdWV1+2fPKRafpjGxrbHNse2xD7piX+V99oL6rz+VdycAAAAAAACTJK
